import React from "react";


function Module(props) {

  return((
    <div className="loginPage">
      <button className="loginPage__headerButton"></button>
      <form className="loginPage__form">
        <h2 className="loginPage__title">Регистрация</h2>
        <input className="loginPage__input" placeholder="Email"></input>
        <input className="loginPage__input" placeholder="Пароль"></input>
        <button className="loginPage__submitButton">Зарегистрироваться</button>
      </form>
      {props.children}
    </div>
  ))
}

export default Module;
